import './main.scss';
import { useHistory } from "react-router-dom";



const Arrows = (props) => {
    const history = useHistory();
  

    return (
        <div id="arrows-div">
            <button onClick={() => console.log(history)}>Back</button>
            {/* <button onClick={() => history.goForward()}>Forward</button> */}
        </div >
    );
}

export default Arrows;
